let ctx = canvas.getContext("2d");
resize = function(){ canvas.height = window.innerHeight, canvas.width = window.innerWidth; };
let drawText = function(){
	resize();
	ctx.font = "bold 18px consolas";
	let w = ctx.measureText(intro.charAt(c)).width;
	ctx.fillStyle = "#CCC";
	ctx.fillRect(0, 0, l, 24);
	ctx.fillStyle = "#000";

},

		title = title.substr(- title.length + 1) + title.charAt(0);

	}
	settitle();
},
drawImg = function(){
	resize();
	let w = Math.ceil(canvas.width / size[0]), h = Math.ceil(canvas.height / size[1]);
	for(var i = 0; i < dlist[c].length; i++){
		ctx.fillStyle = clist[dlist[c].charCodeAt(i) - 65];

	setTimeout(drawImg, int * .7);
}
